import Link from 'next/link';

interface IProps {
    clients: any,
    reverse: boolean
    sortBy: string
  }

const ClientsList = ({clients} : IProps) => {
    let array = clients;

    // reverse ? array = array.reverse() : array;

    // sortBy !== "" ? array.sort((a : any, b : any) => b > a ? -1 : 1);

    array.map((e:any) => (
      <tr key={e._id}>
        <td>{e.dateAdded}</td>
        <td>{e.name}</td>
        <td>{e.age}</td>
        <td>{e.address}</td>
        <td>
          <Link href="/clients/[id]" as={`/clients/${e._id}`}>
            <a>Go to client</a>
          </Link>
        </td>
      </tr>
    ));
    return array;
  };

  export default ClientsList;
